import React from "react";
import "./About.css";

//creo el componente funcional About que se mostrará en la ruta /about
export default function About() {
    return (
        <div>
            <h1>
                <em>C</em>
                <em class="planet left">O</em>
                <em>S</em>
                <em>M</em>
                <em class="planet right">O</em>
                <em>S</em>
            </h1>

        </div>

    )
}
